import React from "react";
import { DiPhp } from "react-icons/di";
import dog from "./dog.jpg";
import "./card.css";

export class Card extends React.Component {
  render() {
    return (
      <div>
        <div id="card_main">
          <label id="card_icon">
            <DiPhp />
          </label>
          <label id="card_level">Beginners</label>
          <h3 id="card_title">Fun with PHP</h3>
        </div>
        <div id="card_para">
          <span id="by">by</span> <img src={dog} alt="" />{" "}
          <span id="card_name">Darrell Steward</span>
        </div>
      </div>
    );
  }
}
